import React from "react";
import styled from "styled-components";

const
Header_Wrapper = styled.div`
display: flex;
flex-flow: row nowrap;
padding: 10px;
background-color: var(--color-grey-phosSilver);
gap: 20px;
font-size: var(--font-root-regular);
`,
Item = styled.div`
margin: ${props => props.margin || 0};
flex: ${props => props.flex || 0};
`,
LogoutWrapper = styled.div`
display: flex;
flex-flow: row nowrap;
align-items: center;
font-size: var(--font-size-large);
font-weight: bold;

span:hover {
cursor: pointer;
color: var(--color-secondary);
}

img {
display: inline-block;
box-sizing: content-box;
width: 35px;
height: 35px;
margin-left: 15px;
}
`,
Header = () => {
  return (
    <Header_Wrapper>
      <Item></Item>
      <Item margin={"0 0 0 auto"}><Logout/></Item>
    </Header_Wrapper>
  );
},
Logout = () => {
  return (
    <LogoutWrapper>
      <span>logout</span>
      <img src="/user_success.png" alt="user-logged-icon"/>
    </LogoutWrapper>
  );
};

export default Header;
